// ==UserScript==
// @name         Scombリンク挿入
// @namespace    https://github.com/yudai1204
// @version      0.1
// @description  ScombZの特定科目ページとサイドメニューに、旧Scombへのリンクを挿入します
// @author       @yudai1204
// @match        https://scombz.shibaura-it.ac.jp/*
// @icon         https://scombz.shibaura-it.ac.jp/favicon.ico
// @grant        none
// ==/UserScript==

(function() {
    'use strict';
    const link = "https://scomb.shibaura-it.ac.jp/portal/contents/home/"; //←ここにScombのリンク
    const insertpages = [
        "https://scombz.shibaura-it.ac.jp/lms/course?idnumber=202201SU0056281001" /* ←ここに挿入したい科目のScombZのページのリンク */
    ]
    if(insertpages.includes(location.href)){
        const insertArea = document.querySelector(".course-header .contents-title");
        if(insertArea){
            insertArea.insertAdjacentHTML("afterEnd",`
            <div class="contents-title">
                    <div class="contents-title-txt">
                        <div class="course-view-title-txt">
                            <span>旧Scomb</span>
                        </div>
                    </div><p>
                    <a href="${link}" style="font-size:120%;margin-left:15px" target="_blank" rel="noopener noreferrer">${link}</a>
                    </p>
                </div>
            `);
        }
    }
    const community = document.querySelector("#sidemenu a.sidemenu-link.community-search-color");
    if(community){
        community.insertAdjacentHTML("afterEnd",`
        <a class="sidemenu-link sidemenu-lms-link sidemenu-link-txt old-scomb-color sidemenu-icon" href="${link}">旧Scomb</a>
        <style>
        .old-scomb-color:before {
            display: block;
            height: 42px;
            width: 42px;
            border-radius: 21px;
            position: absolute;
            z-index: 21;
            left: 10px;
            background: url(data:image/png;base64,) top left no-repeat;
            background-position: 3px 3px;
            background-color: #c8bfe7;
            background-size: 36px 36px;
            content: "";
            transform: translateY(-9px);
        }
        </style>
        `);
    }
})();